import styleAvatar from "./styleAvatar";
import Link from "next/Link";

export default function Avatar(props) {
  return (
    <>
      <Link href="/about">
        <img width={props.size} src="../img/octocat.png" />
      </Link>
      <style jsx>{styleAvatar}</style>
    </>
  );
}
